import './App.css';


function App() {
  return (
    <div className="App">
      <div className='container mx-auto'>
         <div className='navbar flex justify-between w-full p-5 h-auto '>
          <h1 className='bg-green-500 text-2xl w-fit h-fit text-white p-5 rounded-full'>ActiveX</h1>
          <ul className='flex justify-between bg-slate-600 text-white p-5 rounded-md w-1/2 text-xl'>
            <li className='px-2'>home</li>
            <li className='px-2'>about</li>
            <li className='px-2'>product</li>
            <li className='px-2'>career</li>
            <li className='px-2'>contact</li>
          </ul>
         </div>
      </div>
    </div>
  );
}

export default App;
